import React,{useEffect} from 'react';
import './News.css';
import AOS from 'aos';
import 'aos/dist/aos.css';
function News() {
    useEffect(() => {
        AOS.init({
            duration: 800
        });
        AOS.refresh();
    }, []);
    return(
        <div className="News_featured py-5">
            <div className="container">
                <h3 className="fs-40 ff-BonVivant cl-red" data-aos="fade-left">Our stories</h3>
                <h4 className="fs-26 fw-bold text-uppercase" data-aos="fade-right">Latest Blogs</h4>
                <div className="row">
                    <div className="col-md-6">
                        <div className="item_post">

                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default News;
